import React from "react";
import { withStyes } from "@material-ui/core/styles";
import {
  Card,
  CardMedia,
  CardContent,
  Typography,
  withStyles
} from "@material-ui/core";

function PokeCard({ name }) {
  return (
    <Card>
      <CardMedia>
        <CardContent>
          <Typography component="p" variant="h6">
            {name}
          </Typography>
        </CardContent>
      </CardMedia>
    </Card>
  );
}

export default withStyles({
  item: {
    minWidth: "350px",
    margin: "1em",
    boxSizing: "boder-box"
  },
  media: {
    minWidth: "200px"
  }
})(PokeCard);
